local function __crc32(str)
  local crc = 0xFFFFFFFF
  for i = 1, #str do
    local b = string.byte(str, i)
    crc = crc ~ b
    for _=1,8 do
      local mask = -(crc & 1)
      crc = (crc >> 1) ~ (0xEDB88320 & mask)
    end
  end
  return (~crc) & 0xFFFFFFFF
end

  
local function __keystream(n, seed)
  local x = (seed ~= 0 and seed or 2463534242) & 0xFFFFFFFF
  local out = table.create(n)
  for i=1,n do
    x = ((x ~ (x << 13)) & 0xFFFFFFFF)
    x = ((x ~ (x >> 17)) & 0xFFFFFFFF)
    x = ((x ~ (x << 5))  & 0xFFFFFFFF)
    out[i] = (x >> 24) & 0xFF
  end
  return out
end


